import Vaastu from './blog-components/Vaastu';

const Vaastudetail = () => {
    return <div>
        <Navbar />
        <PageHeader headertitle="Vastu Purush Mandala And Devata"  />
        <Vaastu />
        <Footer />
    </div>
}

export default Vaastudetail
